import React from "react";
import './style.css';

function Landing() {
    return(
        <div className="landing">
            <h1><b>Hello, I'm Pat</b></h1>
            <h3>I'm a <b className="highlight"><i>Full Stack</i></b> Developer</h3>
        </div>
    )
}

export default Landing;
